<script>import { get_current_component } from "svelte/internal";
import { El } from "../el";
export let componentName = "breadcrumb";
export let separator = void 0;
const components = [
  { component: get_current_component(), except: [] },
  ...$$props.components ?? []
];
let props = {};
let cssProps = {};
$: {
  cssProps = {
    separator
  };
  props = {
    componentName
  };
}
</script>

<El {components} tag="nav" aria-label="breadcrumb">
	<El tag="ol" {...$$restProps} {cssProps} {...props}>
		<slot />
	</El>
</El>
